import { Component } from "react";
import "./item.css"


class Item extends Component {
    render() {
        return (
            <div className="item-container">
                <img className="item-image" src='https://www.google.com/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2Fthumb%2F1%2F11%2FTest-Logo.svg%2F783px-Test-Logo.svg.png&imgrefurl=https%3A%2F%2Fcommons.wikimedia.org%2Fwiki%2FFile%3ATest-Logo.svg&tbnid=J0lwc2BXZpJQ_M&vet=12ahUKEwjBlcy41vrvAhUHc5QKHTKwBfwQMygEegUIARDdAQ..i&docid=EuN6YaiUCYzImM&w=783&h=359&q=test%20image&ved=2ahUKEwjBlcy41vrvAhUHc5QKHTKwBfwQMygEegUIARDdAQ'></img>
            </div>
        );
    }
}
export default Item;
